class NumArray(object):
    def __init__(self, nums):
        """
        initialize your data structure here.
        :type nums: List[int]
        """
        self.nums = nums

    def sumRange(self, i, j):
        """
        sum of elements nums[i..j], inclusive.
        :type i: int
        :type j: int
        :rtype: int
        """
        sum = 0

        if i >= j:
            return 0

        if i < 0:
            i = 0

        if j > len(self.nums):
            j = len(self.nums) - 1

        for index in range(i, j, 1):
            sum += self.nums[index]

        return sum

